import React from 'react'
import {Row, Col} from 'react-bootstrap'

function Homescreen() {
  return (
    <div>
        <Row>
            {products.map(product =>(
                <Col><h3>{product.name}</h3></Col>
            ))}
        </Row>
    


    </div>
  )
}

export default Homescreen
